import { AddProduct } from 'components/AddProduct';
import Head from 'next/head';
import Link from 'next/link';

export default function AddItems(): JSX.Element {
  return (
    <div className="container">
      <Head>
        <title>Add product</title>
      </Head>
      <Link href="/" as="/">
        <a>All products</a>
      </Link>
      <AddProduct />
    </div>
  );
}
